import {
    FETCH_ALL,
    CREATE,
} from "../constants/actionTypes.js";

export default (tours = [], action) => {
    switch (action.type) {
        case FETCH_ALL:
            return action.payload;
        case CREATE:
            return [...tours, action.payload];
        default:
            return tours;
    }
};
